import Vue from 'vue';
import App from './App.vue';  // Este es tu componente principal

Vue.config.productionTip = false;

new Vue({
  render: h => h(App),  // Renderiza el componente App (que incluye HomePage)
}).$mount('#app');  // Monta la app en el elemento con id 'app'
